<template>  <div class="section-three" @click="jump('dldt')">    <img src="https://file.daqsoft.com/uploadfile/server/geekui/panda/PC/big/img02.jpg" alt="" />  </div></template><script>import { getNewsList } from '@/service/apiList/common'export default {  name: 'sectionThree',  inject: ['PCJumpDetails'],  methods: {    jump(text) {      getNewsList({        channelCode: text,      }).then((res) => {        if (res.code === 0) {          try {            this.PCJumpDetails(res.datas[0], 'ykfw')          } catch (error) {            return ''          }        }      })    },  }}</script><style lang="scss" scoped>.section-three {  width: 100%;  position: relative;  cursor: pointer;  img {    width: 100%;  }}</style>